export const calculateCompatibility = (
	day,
	month,
	year,
	dayPartner,
	monthPartner,
	yearPartner
) => {
	const dateNumbers = `${day}${month}${year}`.split("").map(Number);
	const dateNumbersPartner = `${dayPartner}${monthPartner}${yearPartner}`
		.split("")
		.map(Number);

	let firstSum = dateNumbers.reduce((acc, num) => acc + num, 0);
	let firstSumPartner = dateNumbersPartner.reduce((acc, num) => acc + num, 0);

	const sumDigits = (num) =>
		num
			.toString()
			.split("")
			.map(Number)
			.reduce((acc, n) => acc + n, 0);

	while (firstSum >= 10) {
		firstSum = sumDigits(firstSum);
	}

	while (firstSumPartner >= 10) {
		firstSumPartner = sumDigits(firstSumPartner);
	}

	const compatibility = compatibilityCases(firstSum, firstSumPartner);

	const characteristic1 =
		characteristicsCases[firstSum] || characteristicsCases[10];
	const characteristic2 =
		characteristicsCases[firstSumPartner] || characteristicsCases[10];

	return {
		characteristic1,
		characteristic2,
		compatibility,
	};
};

